import React from "react";
import "./styles.css";
import Navbar from "../Navbar/Navbar";
import logo from "../images/logo.jpg";
function Home() {
  return (
    <div className="home-container">
      <div className="head">
        <Navbar />
        <div className="logo-wrapper">
          <img src={logo} alt="logo" />
        </div>
      </div>
    </div>
  );
}

export default Home;
